export function getCharacterFinder(character: string) {
  if (character in CharacterFinderMap) {
    return CharacterFinderMap[character as keyof typeof CharacterFinderMap];
  }
  throw new Error(`Unknown character in CharacterFinderMap: ${character}`);
}

function createDrawPathFinder(drawPath: string) {
  return (element: Element) => {
    const character = element.querySelector(".character");

    if (character) {
      const elementDrawPath = character.getAttribute("d");
      if (elementDrawPath) {
        return elementDrawPath === drawPath;
      }
    }
  };
}

function createPolygonPointsFinder(polygonPoints: string) {
  return (element: Element) => {
    const character = element.querySelector("polygon");
    if (character) {
      const elementPolygonPoints = character.getAttribute("points");
      if (elementPolygonPoints) {
        return elementPolygonPoints === polygonPoints;
      }
    }
  };
}
